function shuffle(array) {

    let counter = array.length;

    // While there are elements in the array
    while (counter > 0) {
        // Pick a random index
        let index = Math.floor(Math.random() * counter);

        // Decrease counter by 1
        counter--;

        // And swap the last element with it
        let temp = array[counter];
        array[counter] = array[index];
        array[index] = temp;
    }

    return array;
}

function randomEmail() {
    const chars = 'abcdefghijklmnopqrstuvwxyz1234567890';
    let string = '';

    for (let ii = 0; ii < 15; ii++) {
        string += chars[Math.floor(Math.random() * chars.length)];
    }

    return string + "@mail.com";
}

function randomAddress() {
    const chars = 'ABCDEFG';
    const street = ['Calle', 'Cra'];
    return `${street[Math.floor(Math.random())]} ${(Math.floor(Math.random() * 200) + 1)}${chars[Math.floor(Math.random() * chars.length)]} #${(Math.floor(Math.random() * 200) + 1)} - ${(Math.floor(Math.random() * 200) + 1)}`;
}

function randomDate(start, end) {
    var date = new Date(+start + Math.random() * (end - start));
    return date;
}

function formatCurrency(num) {
    var formatter = new Intl.NumberFormat('en-EN', {
        style: 'currency',
        currency: 'USD',
    });
    return formatter.format(num);
}
